INSERT INTO `v1_91ca9c20b9f5124711b8ee0ddeee6da3904488b50b83f32928157d8e0fa7c2b9` VALUES ("2030/01/01 14:59:59", 0.0, -416.5, 2.1, 3001, "ミッションねえ……\nちょうどいいや\nどこまで片付けられるか\n賭けをしようじゃないか", "2024/10/31 12:00:00", 3001100, 100, 1, 2, "ヤマト", 130011);
